898798c8cb290b2821ce0f7e93fea2153c9e3114:
query PetDetail($id: String!) {
  pets(where: {id: {equals: $id}}) {
    id
    createdAt
    name
    adoption {
      id
      adopter {
        id
        email
        profile {
          fullName
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

ffb74998622e9acd9f24fb9362ec50e9ae613590:
query getPets {
  pets(orderBy: {createdAt: asc}) {
    id
    name
    createdAt
    updatedAt
    adoption {
      adopter {
        id
        __typename
      }
      __typename
    }
    __typename
  }
}

cc485ebafd250a1e2ac73c7a5fb3331e63454c5c:
mutation adoptPet($pet: PetWhereUniqueInput!) {
  adoptPet(pet: $pet) {
    id
    adoptee {
      id
      __typename
    }
    adopter {
      id
      __typename
    }
    __typename
  }
}

f3f503048cac770f3caa4b8ea7b40f3ff6d28acd:
mutation login($email: String!, $password: String!) {
  login(email: $email, password: $password) {
    token
    __typename
  }
}

0e2ca39120c6e451fd62c60f60bf1fd3f03b7e7d:
mutation signup($data: SignupInput!) {
  signup(data: $data) {
    token
    user {
      id
      __typename
    }
    __typename
  }
}
